import logo from './logo.svg';
import Button from './components/Button'
import NewButton from './components/NewButton';
import Input from './components/Input';
import './App.css';

function App() {
  return (
    <div className="grid place-items-center">
      <form className="grid grid-cols-2 gap-1 max-w-lg">
      <span className="min-h-full"></span>
      <p className="text-center text-lg col-span-2">Task</p>
      <div className="col-span-2">
      <Input placeholder="Task Name"/>
      </div>
      <div className="col-span-2">
      <Input placeholder="Expected Time To Complete"/>
      </div>
      <Input placeholder="Start Date"/>
      <Input placeholder="Start Time"/>
      <Input placeholder="Deadline Date"/>
      <Input placeholder="Deadline Time"/>

      <div className="col-span-2">
      <Button>
        Submit
      </Button>
      </div>

    </form>
    </div>
  );
}


export default App;
